def calculate_max_days(n, m, food_types):
    food_count = {}
    for food_type in food_types:
        if food_type in food_count:
            food_count[food_type] += 1
        else:
            food_count[food_type] = 1
    food_counts = list(food_count.values())
    max_days = max(food_counts)
    while max_days >= 0:
        if sum([count // max_days for count in food_counts]) >= n:
            return max_days
        else:
            max_days -= 1
    return max_days

